import React, { useEffect, useState } from "react";
import "../styles/Boutique.css";

function BoutiqueSection() {
  const [chocolats, setChocolats] = useState([]);

  useEffect(() => {
    fetch('data.json')
      .then(response => response.json())
      .then(data => setChocolats(data.chocolats))
      .catch(error => console.log(error));
  }, []);

  function ListeChocolats() {
    return chocolats.map((v, index) => (
      <section>
        <h2>{v.title}</h2>
        <p>prix : {v.price} â‚¬</p>
        <p>Note : {v.note}</p>
        <img src={v.image} alt="imgjson" />
      </section>
    ));
  }

  return <ListeChocolats />;
}

export default BoutiqueSection;
